// src/components/ModelInsights.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // <-- 1. Import useNavigate
import { BrainCircuit, GitCompareArrows } from 'lucide-react';
import Modal from './Modal';

export default function ModelInsights() {
  const navigate = useNavigate(); // <-- 2. Initialize the hook
  const [isCompareModalOpen, setIsCompareModalOpen] = useState(false);
  // We no longer need the state for the performance modal

  return (
    <>
      <div className="bg-gray-800 p-6 rounded-lg shadow-lg border border-gray-700">
        <h2 className="text-2xl font-semibold mb-4 border-b border-gray-600 pb-3">Model Insights</h2>
        <div className="space-y-4">
          
          {/* --- THIS IS THE CHANGE --- */}
          <button 
            onClick={() => navigate('/performance')} // <-- 3. Navigate on click
            className="w-full flex items-center justify-center space-x-3 bg-gray-700 ...">
            <BrainCircuit size={20} />
            <span>View Training Performance</span>
          </button>
          
          {/* The other button still opens a modal */}
          <button onClick={() => setIsCompareModalOpen(true)} className="w-full flex ...">
            <GitCompareArrows size={20} />
            <span>Compare v7 vs v8 Results</span>
          </button>
        </div>
      </div>

      {/* We no longer need the performance modal */}
      <Modal isOpen={isCompareModalOpen} onClose={() => setIsCompareModalOpen(false)} title="YOLOv7 vs YOLOv8 Comparison">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <img src="/images/yolov7_results.png" alt="YOLOv7" />
          <img src="/images/yolov8_results.png" alt="YOLOv8" />
        </div>
      </Modal>
    </>
  );
}
